        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </div>
      <div className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </div>
